B.kW=s(["Cheon Ji|\ucc9c\uc9c0|\u5929\u5730|Himmel und Erde, steht f\xfcr den Anfang.|19|1|Bedeutet Himmel und Erde (\u5929 und \u5730). Dieser Hyeong steht f\xfcr den Anfang.","Dan Gun|\ub2e8\uad70|\u6a80\u541b|Ein Heiliger, welcher der Legende nach 2333 v.Chr Korea erschaffen hat.|21|2|Benannt nach dem heiligen Dan Gun, der 2333 v.Chr. Korea gergr\xfcndet haben soll.","Do San|\ub3c4\uc0b0|\u5cf6\u5c71|Koreanischer Patriot, Anf\xfchrer der koreanischen Unabh\xe4ngigkeitsbewegung.|24|3|Do San ist der Pseudonym des Patrioten An Chang Ho (\uc548\ucc3d\ud638) (1878-1938). Er war ein Koreanischer Politiker, Unabh\xe4ngigkeitsaktivist, und Leiter der 'Korean-American immigrant community' in den USA. Er und seine Frau waren da erste Koreanischer Ehepaar, das legal in die USA einreiste.","Won Hyo|\uc6d0\ud6a8|\u5143\u66c9|Buddhistischer M\xf6nch, der Buddhismus in Korea verbreitete.|28|4|Won Hyo war ein ein buddhistischer M\xf6nch in Korea. Er hat sich f\xfcr die Verbreitung des Buddhismus in Korea eingesetz","Yul Gok|\uc728\uace1|\u6817\u8c37|Der Philosoph Yi I hat sich intensiv mit dem 'Ki', der Energie, besch\xe4ftigt.|38|5|Yul Gok war der K\xfcnstlername des Philosophen Yi I (\uc774\uc774). Gemeinsam mit Toi Gye (Yi Hwang) war er einer der beiden gro\xdfen Philosophen seiner Zeit. Er legte besonderen Wert auf die Lebensenergie, dem 'KI' ","Jung Geun|\uc911\uadfc|\u91cd\u6839|Freiheitsk\xe4mpfer, bekannt f\xfcr den Mord eines Japanischen Premirministers.|32|6|An Jung Geun (\uc548\uc911\uadfc) war ein Koreanischer Freiheitsk\xe4mpfer. Er ist ber\xfchmt f\xfcr die Ermordung des Japanischen Ministerpr\xe4sidenten, der damals \xfcber Korea regierte.","Toi Gye|\ud1f4\uacc4|\u9000\u6eaa|Der Philosoph Yi Hwang hat sich intensiv mit dem 'Li', der Ordnung, besch\xe4ftigt.|37|7|Toi Gye ist der K\xfcnstlername des Philosophen Yi Hwang (\uc774\ud669). Im Gegensatz zu Yul Gok (Yi I), legte er mehr Wert auf die Ordnung (Ri), statt der Energie (Ki).","Hwa Rang|\ud654\ub791|\u82b1\u90de|Eine Gruppe jugendlicher Arsitokraten, die Literatur und Kampfkunst lernten.|29|8|Hwa Rang war eine Gruppe aristokratischer Jugendlicher, die eine Gute Bildung genossen. Sie lernten unter anderem Recht, Philosophie, Literatur und Kampfkunst.","Chung Mu|\ucda9\ubb34|\u5fe0\u6b66|Yi Sun Shin war ein Admiral, bekannt f\xfcr seine Schildkr\xf6tenschiffe.|30|9|Yi Sun Shin (\uc774\uc21c\uc2e0) war ein Koreanischer Admiral. Er wird als einer der gr\xf6\xdften Helden in Korea gefeiert. Er soll mit nur 13 Schiffen gegen 333 japanische Schiffe in einer Schlacht gewonnen haben.","Gwang Gye|\uad11\uac1c|\u5ee3\u958b|Ein K\xf6nig, der gro\xdfe Teile der Mandschurei zur\xfcckeroberte.|39|10|Gwang Gae To Tae Wang (Hanja: \u5ee3\u958b\u571f\u5927\u738b) war ein K\xf6nig von Goguryeo der gro\xdfe Teile der Mandschurei zur\xfcckeroberte."],t.s)
